  CONSTRAINT `fk_frequencia_inforfrequencia` FOREIGN KEY (`fk_id_infor_freq`) REFERENCES `infor_frequencias` (`id_infor_freq`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2280 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
